import React from "react";

const AddTask = () => {
  return (
    <section className="addTask">
      <form>
        <input type="text" placeholder="Add Task" maxLength={100}></input>
        <button type="button">Add Task </button>
      </form>
    </section>
  );
};

export default AddTask;
